        #region Copy Fields From
        public static void CopyFieldsFrom(
            Model item,
            Model rhs,
            Model def,
            ErrorMaskBuilder errorMask,
            Model_CopyMask copyMask)
        {
            if (copyMask?.File ?? true)
            {
                errorMask?.PushIndex((int)Model_FieldIndex.File);
                try
                {
                    item.File = rhs.File;
                }
                catch (Exception ex)
                when (errorMask != null)
                {
                    errorMask.ReportException(ex);
                }
                finally
                {
                    errorMask?.PopIndex();
                }
            }
            if (copyMask?.BoundRadius ?? true)
            {
                errorMask?.PushIndex((int)Model_FieldIndex.BoundRadius);
                try
                {
                    item.BoundRadius = rhs.BoundRadius;
                }
                catch (Exception ex)
                when (errorMask != null)
                {
                    errorMask.ReportException(ex);
                }
                finally
                {
                    errorMask?.PopIndex();
                }
            }
            if (copyMask?.Hashes ?? true)
            {
                errorMask?.PushIndex((int)Model_FieldIndex.Hashes);
                try
                {
                    if (LoquiHelper.DefaultSwitch(
                        rhsItem: rhs.Hashes,
                        rhsHasBeenSet: rhs.Hashes_IsSet,
                        defItem: def?.Hashes ?? default(Byte[]),
                        defHasBeenSet: def?.Hashes_IsSet ?? false,
                        outRhsItem: out var rhsHashesItem,
                        outDefItem: out var defHashesItem))
                    {
                        item.Hashes = rhsHashesItem;
                    }
                    else
                    {
                        item.Hashes_Unset();
                    }
                }
                catch (Exception ex)
                when (errorMask != null)
                {
                    errorMask.ReportException(ex);
                }
                finally
                {
                    errorMask?.PopIndex();
                }
            }
        }

        #endregion

        partial void ClearPartial();

        public virtual void Clear(IModel item)
        {
            ClearPartial();
            item.File = default(String);
            item.BoundRadius = default(Single);
            item.Hashes_Unset();
        }

        public Model_Mask<bool> GetEqualsMask(
            IModelGetter item,
            IModelGetter rhs,
            EqualsMaskHelper.Include include = EqualsMaskHelper.Include.All)
        {
            var ret = new Model_Mask<bool>();
            ((ModelCommon)((ILoquiObject)item).CommonInstance).FillEqualsMask(
                item: item,
                rhs: rhs,
                ret: ret,
                include: include);
            return ret;
        }

        public void FillEqualsMask(
            IModelGetter item,
            IModelGetter rhs,
            Model_Mask<bool> ret,
            EqualsMaskHelper.Include include = EqualsMaskHelper.Include.All)
        {
            if (rhs == null) return;
            ret.File = string.Equals(item.File, rhs.File);
            ret.BoundRadius = item.BoundRadius.EqualsWithin(rhs.BoundRadius);
            ret.Hashes = item.Hashes_IsSet == rhs.Hashes_IsSet && MemoryExtensions.SequenceEqual(item.Hashes, rhs.Hashes);
        }

